// this is will added to the page you are targetting in manifest.json

const SELECTOR_PROMPT_INPUT = "div.bottom > div.round > div.selfTurn input";
const SELECTOR_PROMPT_QUESTION = "div.middle > div.canvasArea > div.round > div";
const SELECTOR_HINT_BOX = "div.bottom > div.round > .hint-box";
const SELECTOR_ROUND = "div.bottom > div.round";
const SELECTOR_JOIN_BUTTON = "div.bottom > div.seating > div.join > button[data-text='joinGame']";
const SELECTOR_SEATING = "div.bottom > div.seating";
const HINT_BOX_STYLE = `
border-radius: 5px;
background: transparent;
color: white;
padding: 5px 10px 0px 10px;
height: 2em;
resize: none;
overflow: hidden;
`;
let isBotRunning = false;
let answerSpeed = 200;

initializeHintBox();
chrome.runtime.onMessage.addListener(chromeMessagesListener);

async function chromeMessagesListener(request, sender, response) {
  switch (request.action) {
    case "toggle-bot":
      isBotRunning = !isBotRunning;
      if (isBotRunning) runBot();
      console.log(`Bot is turned ${isBotRunning ? "ON" : "OFF"}`);
      break;
    case "answer-speed":
      answerSpeed = request.speed;
      break;
    case "bot-data":
      await chrome.runtime.sendMessage({
        action: "bot-data",
        isBotRunning: isBotRunning,
        answerSpeed: answerSpeed,
      });
      break;
  }
}

function initializeHintBox() {
  const roundDiv = document.querySelector(SELECTOR_ROUND);
  const hintBox = document.createElement("textarea");
  roundDiv.style["gap"] = "10px";
  roundDiv.style["padding"] = "10px";
  hintBox.classList.add("hint-box"); // for selector
  hintBox.setAttribute("style", HINT_BOX_STYLE);
  roundDiv.appendChild(hintBox);
  hintBox.onclick = hintBoxOnClickListener;
  // make everything of equal width
  [...roundDiv.children].forEach(child => (child.style["flex"] = "1"));
}

function hintBoxOnClickListener() {
  this.select();
  document.execCommand("copy");
}

async function runBot() {
  if (isJoinGameButtonHidden()) await answerQuestion(getPromptQuestion());
  else await clickJoinButton();
  if (isBotRunning) setTimeout(runBot, 1000);
}

async function clickJoinButton() {
  console.log("click join button " + isJoinGameButtonHidden());
  await sleep(10_000 * Math.random());
  const joinButton = getJoinGameButton();
  if (joinButton) joinButton.click();
}

function getJoinGameButton() {
  return document.querySelector(SELECTOR_JOIN_BUTTON);
}

function isJoinGameButtonHidden() {
  return isHidden(document.querySelector(SELECTOR_SEATING));
}

async function answerQuestion(syllable) {
  if (syllable.length === 0) return [];
  let answer = getAnswer(syllable);
  if (isMyTurn()) {
    if (Math.random() <= 0.9) {
      // 90% of the time write correct answer
      await writeDataInPrompt(answer);
      return;
    }
    await answerRandomWord();
    return;
  }
  writeDataInHintBox(answer);
  // wait while question does not change or my turn comes
  while (!isMyTurn() && getPromptQuestion() === syllable && isJoinGameButtonHidden())
    await sleep(25);
}

async function answerRandomWord() {
  // random words are long sentences so write them as fast as possible
  // without drawing suspecion of bot
  const temp = answerSpeed;
  answerSpeed = Math.min(answerSpeed, 80);
  await writeDataInPrompt(randomWords[generateNumber(randomWords.length)]);
  answerSpeed = temp;
}

function getAnswer(syllable) {
  if (syllable.length === 0) return [];
  let seed = generateNumber(words.length);
  for (let i = 0; i < words.length; i++) {
    const idx = (seed + i) % words.length;
    if (words[idx].includes(syllable)) return words[idx];
  }
  return randomWords[generateNumber(randomWords.length)];
}

function getPromptQuestion() {
  return document.querySelector(SELECTOR_PROMPT_QUESTION).textContent;
}

function writeDataInHintBox(data) {
  const hintBox = document.querySelector(SELECTOR_HINT_BOX);
  hintBox.value = data;
}

async function writeDataInPrompt(data) {
  const promptInput = document.querySelector(SELECTOR_PROMPT_INPUT);
  for (let i = 0; i < data.length; i++) {
    promptInput.value = data.slice(0, i + 1);
    promptInput.dispatchEvent(new Event("input"));
    await sleep(Math.floor(answerSpeed * Math.random()));
  }
  await submitWord();
}

async function submitWord() {
  document.querySelector(".selfTurn form").dispatchEvent(new Event("submit"));
  await sleep(250);
}

function isMyTurn() {
  const selfTurnDiv = document.querySelector("div.selfTurn");
  return selfTurnDiv && !isHidden(selfTurnDiv);
}

function isHidden(element) {
  return element.hasAttribute("hidden");
}

function generateNumber(max) {
  return Math.floor(Math.random() * max);
}

function sleep(milliseconds) {
  return new Promise(resolve => {
    const interval = setInterval(() => {
      clearInterval(interval);
      resolve();
    }, milliseconds);
  });
}
